import React, { Component } from 'react';
import fire from '../config/fire';
import "../statics/styles.scss"
import Header from '../components/Header.js'

export default class Assigned extends Component {
    constructor(props) {
        super(props);
        this.state = {
            user: this.props.user
        }
        this.state.user = fire.auth().currentUser;
    }
    
    render() {
        if (!this.state.user) {
            return (<div>test</div>)
        } else {
        return (
            <div>
                <Header />
                <main></main>
            </div>
        );
    }   
    }
}
